const categories = [
  {
    question:
      "Does everyone on my team have to meet the standards for the category we want to select?",
    answer:
      "No, the recommendation is that at least 2 athletes should meet the standards and the other 2 should have a level close to that of the standards. Try curating a team where everyone has complimentary strengths and weakneses (e.g. One person can do HSPU, one is a good lifter, etc...)",
  },
  {
    question: "two",
    answer: "two",
  },
  {
    question: "three",
    answer: "three",
  },
];

module.exports = { categories };
